import React from 'react';
import { CatagoryInfos } from './CatagoryFullinfos';
import CatagoryCard from './CatagoryCard';
import classes from './Catagory.module.css'; // Ensure CSS import is correct

function Catagory() {
    return (
        <section className={classes.category_container}>
            {CatagoryInfos.map((category, index) => (
                <CatagoryCard key={category.name || index} data={category} />  // Self-closing tag
            ))}
        </section>
    );
}

export default Catagory;
